svg.script:
  (function() {
    var svg = document.getElementById('geigenpraetorius');
    var instrumentname = document.getElementById('instrumentname');
    var instrumentnameText = instrumentname.getElementsByTagName('text')[0];
    var instrumentnameRects = instrumentname.getElementsByTagName('rect');
    var triggers = document.getElementsByClassName('instrument');
    for (var i = 0; i < triggers.length; i++) { triggers[i].addEventListener('mousemove', showInstrumentName); triggers[i].addEventListener('mouseout', hideInstrumentName);
    }
    var triggersLinks = document.getElementsByClassName('instrumentLinks');
    for (var i = 0; i < triggersLinks.length; i++) { triggersLinks[i].addEventListener('mousemove', showInstrumentNameLinks); triggersLinks[i].addEventListener('mouseout', hideInstrumentName);
    }
    function showInstrumentName(evt) {
       var CTM = svg.getScreenCTM();
	   var x = (evt.clientX - CTM.e + 6) / CTM.a;
	   var y = (evt.clientY - CTM.f + 20) / CTM.d;
	   instrumentname.setAttributeNS(null, "transform", "translate(" + x + " " + y + ")");
       instrumentname.setAttributeNS(null, "visibility", "visible");
       instrumentnameText.firstChild.data = evt.target.getAttributeNS(null, "data-instrument-term"); 
       var length = instrumentnameText.getComputedTextLength();
       for (var i = 0; i < instrumentnameRects.length; i++) {
       instrumentnameRects[i].setAttributeNS(null, "width", length + 13.3);
       }
    }
    function showInstrumentNameLinks(evt) {
       var CTM = svg.getScreenCTM();
	   var x = (evt.clientX - CTM.e + 50) / 0.38 * CTM.a;
	   var y = (evt.clientY - CTM.f + -20) / CTM.d;
	   instrumentname.setAttributeNS(null, "transform", "translate(" + x + " " + y + ")");
       instrumentname.setAttributeNS(null, "visibility", "visible");
       instrumentnameText.firstChild.data = evt.target.getAttributeNS(null, "data-instrument-term"); 
       var length = instrumentnameText.getComputedTextLength();
       for (var i = 0; i < instrumentnameRects.length; i++) {
       instrumentnameRects[i].setAttributeNS(null, "width", length + 13.3);
       }
    }
    function hideInstrumentName(evt) {
        instrumentname.setAttributeNS(null, "visibility", "hidden");
    }
  })();
